import './App.css';
import React from 'react';
import { connect } from 'react-redux';
import Header from './Components/Header.js';
import NavigationBar from './Components/NavigationBar';
import Services from './Components/Services';
import GalleryCarousel from './Components/GalleryCarousel';
import HowToFindUs from './Components/HowToFindUs';
import NewsCarousel from './Components/NewsCarousel';
import StaffMainMenu from './Components/StaffMainMenu';
import Booking from './Components/UnauthenticatedMainMenu/Booking/Booking';
import Feedbacks from './Components/DataTablesComponents/Feedbacks';

class App extends React.PureComponent {
  render() {
    if (this.props.employeeToken === '') {
      if (!this.props.bookingInProcess) {
        return (
          <div className="App">
            <Header />
            <NavigationBar />
            <div className="main">
              <div className="main_window">
                <div className="carousels">
                  <div className="mainPage">
                    <HowToFindUs />
                  </div>
                </div>
              </div>
            </div>
          </div>
        );
      } else {
        if (this.props.activeMemu === 'feedbacksPage') {
          return (
            <div className="App">
              <Header />
              <NavigationBar />
              <div className="main">
                <div className="main_window">
                  <div className="carousels">
                    <div className="mainPage">
                      <Feedbacks />
                    </div>
                  </div>
                </div>
              </div>
            </div>
          );
        } else if (this.props.activeMemu === 'employeesPage') {
          return (
            <div className="App">
              <Header />
              <NavigationBar />
              <div className="main">
                <div className="main_window">
                  <div className="carousels">
                    <div className="mainPage">
                      <HowToFindUs />
                    </div>
                  </div>
                </div>
              </div>
            </div>
          );
        } else if (this.props.activeMemu === 'servicesPage') {
          return (
            <div className="App">
              <Header />
              <NavigationBar />
              <div className="main">
                <div className="main_window">
                  <div className="carousels">
                    <div className="mainPage">
                      <HowToFindUs />
                    </div>
                  </div>
                </div>
              </div>
            </div>
          );
        } else if (this.props.activeMemu === 'aboutUsPage') {
          return (
            <div className="App">
              <Header />
              <NavigationBar />
              <div className="main">
                <div className="main_window">
                  <div className="carousels">
                    <div className="mainPage">
                      <HowToFindUs />
                    </div>
                  </div>
                </div>
              </div>
            </div>
          );
        } else
          return (
            <div className="App">
              <Header />
              <NavigationBar />
              <div className="main">
                <div className="main_window">
                  <div className="mainPage">
                    <Booking />
                  </div>
                </div>
              </div>
            </div>
          );
      }
    } else {
      return (
        <div className="App">
          <Header />
          <NavigationBar />
          <div className="main">
            <div className="main_window">
              <div className="mainPage">
                <StaffMainMenu />
              </div>
            </div>
          </div>
        </div>
      );
    }
  }
}

function mapStateToProps(state) {
  return {
    employeeToken: state.employeeToken,
    responseDataList: state.responseDataList,
    singleResponseData: state.singleResponseData,
    bookingInProcess: state.bookingInProcess,
    activeMemu: state.activeMemu,
  };
}

function mapDispatchToProps(dispatch) {
  return {};
}

export default connect(mapStateToProps, mapDispatchToProps)(App);
